import React, { Component } from "react";
import variables from './../variables';
import { Button, Table, Modal, ModalHeader, ModalBody, FormGroup, Label, Input, ModalFooter, Dropdown, DropdownToggle, DropdownMenu, DropdownItem, Form, Row, Col } from 'reactstrap';

export class PrescriptionForm extends Component {
    constructor(props) {
        super(props);
        this.state = {
            prescription_id: 0,
            complaints: "",
            diagnosis: "",
            rx: "",
            investigation: "",
            lifestyle: "",
            last_checkup_id: "",
            pulse_rate: "",
            bp: "",
            temp: "",
            weight: "",
            age: "",
            confirmation: "",
            doctor: {
                doctor_id: "",
                doctor_name: "",
            },
            booklet: {
                booklet_id: "",
            },
            booklets: [],
            doctors: [],
            prescriptions: []

        }
    }


    refreshList() {
        fetch(variables.API_URL + 'prescription/')
            .then(response => response.json())
            .then(data => {
                if ('data' in data && Array.isArray(data.data)) {
                    console.log(data)
                    this.setState({
                        prescriptions: data.data

                    });
                } else {
                    console.error('Expected an object with a data property containing a single booklet object, but got ', data);
                }
            });

        fetch(variables.API_URL + 'ebooklet/')
            .then(response => response.json())
            .then(data => {
                if ('data' in data && Array.isArray(data.data)) {
                    this.setState({
                        booklets: data.data
                    });
                } else {
                    console.error('Expected an object with a data property containing a single booklet object, but got ', data);
                }
            });

        fetch(variables.API_URL + 'doctor/')
            .then(response => response.json())
            .then(data => {
                if ('data' in data && Array.isArray(data.data)) {
                    const doctors = data.data.map(doctor => {
                        return {
                            doctor_id: doctor.doctor_id,
                            doctor_name: doctor.doctor_name,
                            specialization: doctor.specialization
                        };
                    });
                    console.log(doctors); // Log the mapped doctors array
                    this.setState({
                        doctors: doctors
                    });
                } else {
                    console.error('Expected an object with a data property containing an array of doctor objects, but got ', data);
                }
            });
    }
    componentDidMount() {
        this.refreshList();
    }
    toggleDropdownDoctor = () => {
        this.setState(prevState => ({
            dropdownOpenDoctor: !prevState.dropdownOpenDoctor
        }));
    };
    handleDoctorSelection(selectedId) {
        this.setState({
            selectedDoctorId: selectedId
        });
    }

    render() {
        const {
            rosters,
            modalTitle,
            groupedByDay,
            roster_id,
            month,
            year,
            doctors,
            
            showModal,
            doctor: {
                doctor_id,
                doctor_name,
                specialization,
            },
            
            selectedDoctorId,
            
        } = this.state;
        return (
            <div style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                height: '100vh'
            }}>
                <Form>
                    <Row >
                     <Col md="4">
                     <FormGroup>
                        <Label for="doctor">Doctor</Label>
                        <Dropdown isOpen={this.state.dropdownOpenDoctor} toggle={this.toggleDropdownDoctor}>
                            <DropdownToggle caret>
                                {this.state.selectedDoctorId ? this.state.selectedDoctorId : "Select Doctor"}
                            </DropdownToggle>
                            <DropdownMenu>
                                {this.state.doctors.map((doctor) => (
                                    <DropdownItem key={doctor.doctor_id} onClick={() => this.handleDoctorSelection(doctor.doctor_id)}>
                                        {doctor.doctor_name} - {doctor.specialization}
                                    </DropdownItem>
                                ))}
                            </DropdownMenu>
                        </Dropdown>
                    </FormGroup></Col>   
                    
                    </Row>
                    
                    <Row>
                        <FormGroup row>
                            <Label
                                for="exampleText"
                            >
                                Complaints
                            </Label>
                            <Input
                                id="exampleText"
                                name="text"
                                type="textarea"
                            />
                        </FormGroup>
                    </Row>




                    <Row>
                        <Col md={4}>
                            <FormGroup>
                                <Label for="exampleCity">
                                    Last Checkup Id
                                </Label>
                                <Input
                                    id="exampleCity"
                                    name="city"
                                />
                            </FormGroup>
                        </Col>
                        <Col md={4}>
                            <FormGroup>
                                <Label for="exampleCity">
                                    Pulse Rate
                                </Label>
                                <Input
                                />
                            </FormGroup>
                        </Col>
                        <Col md={4}>
                            <FormGroup>
                                <Label for="exampleCity">
                                    Blood Pressure
                                </Label>
                                <Input
                                    id="exampleCity"
                                    name="city"
                                />
                            </FormGroup>
                        </Col>
                    </Row>
                    <Row>
                        <Col md={4}>
                            <FormGroup>
                                <Label for="exampleCity">
                                    Temperature
                                </Label>
                                <Input
                                    id="exampleCity"
                                    name="city"
                                />
                            </FormGroup>
                        </Col>
                        <Col md={4}>
                            <FormGroup>
                                <Label for="exampleCity">
                                    Weight
                                </Label>
                                <Input
                                    id="exampleCity"
                                    name="city"
                                />
                            </FormGroup>
                        </Col>
                        <Col md={4}>
                            <FormGroup>
                                <Label for="exampleCity">
                                    Age
                                </Label>
                                <Input
                                    id="exampleCity"
                                    name="city"
                                />
                            </FormGroup>
                        </Col>
                    </Row>
                    <Row>
                        <FormGroup row>
                            <Label
                                for="exampleText"
                            >
                                Diagnosis
                            </Label>
                            <Input
                                id="exampleText"
                                name="text"
                                type="textarea"
                            />
                        </FormGroup>
                    </Row>
                    <Row>
                        <FormGroup row>
                            <Label
                                for="exampleText"
                            >
                                <h4>R<sub>x</sub></h4>
                            </Label>
                            <Input
                                id="exampleText"
                                name="text"
                                type="textarea"
                            />
                        </FormGroup>
                    </Row>
                    <Row>
                        <FormGroup row>
                            <Label
                                for="exampleText"
                            >
                                Investigation
                            </Label>
                            <Input
                                id="exampleText"
                                name="text"
                                type="textarea"
                            />
                        </FormGroup>
                    </Row>
                    <Row>
                        <FormGroup row>
                            <Label
                                for="exampleText"
                            >
                                Lifestyle
                            </Label>
                            <Input
                                id="exampleText"
                                name="text"
                                type="textarea"
                            />
                        </FormGroup>
                    </Row>
                    <Row>

                    </Row>
                    <Button>
                        Submit
                    </Button>
                </Form>
            </div>
        );
    }
}

export default PrescriptionForm;
